    permits the control of water on 1,354 acres of major pools within the swampland
    basin, and on 449 acres of upland marshes on tributaries leading to the swampland
    - for a total of 1,803 acres. In addition to these completed developments, this
    plan considers also the management of water within Master Plan Units 4 and 5 totaling
    2,070 acres which are under development at this time. With the welfare of waterfowl
    as a major refuge objective, the proper management of the water resource is a primary
